-- INSERTs only for policy (500 rows)



UPDATE policy
SET policy_type = CASE
    WHEN LOWER(TRIM(policy_type)) = 'private car' THEN 'PRIVATE_CAR'
    WHEN LOWER(TRIM(policy_type)) = 'private_car' THEN 'PRIVATE_CAR'
    WHEN LOWER(TRIM(policy_type)) = 'commercial' THEN 'COMMERCIAL'
    WHEN LOWER(TRIM(policy_type)) = 'motorcycle' THEN 'MOTORCYCLE'
    ELSE 'OTHER'
END;

UPDATE policy
SET policy_number = REPLACE(policy_number, '-', '');